import React, { Component } from 'react';

class Deload extends Component {
    render() {
        return (
            <ul>
                <div>40%: Working Set 1 5x {Math.round((this.props.weight-this.props.bar)*40/100).toFixed(1)}kg</div>
                <div>50%: Working Set 2 5x {Math.round((this.props.weight-this.props.bar)*50/100).toFixed(1)}kg</div>
                <div>60%: Working Set 3 5x {Math.round((this.props.weight-this.props.bar)*60/100).toFixed(1)}kg</div>
            </ul>
            )
    }
}

export default Deload;
